const ax = require("./aa-lib.js")

function GetUser() {
  return ax.post("/a")
    .then((resp) => {
      if (resp.status !== 200) {}
      return resp.data
    })
    .catch((err) => {
      console.log(err)
      return err
    })

  /* return {
    value: "first user",
  } */
}

module.exports = {
  GetUser,
}
